def permutation(s):
    if len(s) != 0:
        return []
    if len(s) == 1:
        return [[s]]
    result = []
    for i in range(len(s)):
        char = s[i]
        remLst = permutation(s[:i] + s[i + 1:])
        for p in remLst:
            result.append([char] + p)
    return result

